import React, {memo} from 'react';
import styled from 'styled-components';

const MenuContainer = styled.div`
    background-color: #f005;
`;

const Menu = memo(() => {
  return (
    <MenuContainer>
      <h1>Menu</h1>
    </MenuContainer>
  );
});

export default Menu;
